import React from 'react';
import { Divider } from 'semantic-ui-react';
class Footer extends React.Component {
    render() {
        return (
            <div className="Footer">
                <Divider hidden />
                <Divider hidden />
                <h1>Salut </h1>
                <Divider hidden />
            </div>
        )
    }
}

export default Footer;
